import { UserContext } from "./AddResource";
import FrontEnd from "./FrontEnd";
import AddResource from "./AddResource";
function ViewResource() {
  return (
    <>
      <h1>Resouces</h1>
      <div>
        <UserContext.Consumer>
          {(user) => {
            <div>{user}</div>;
          }}
        </UserContext.Consumer>
      </div>
    </>
  );
}

export default ViewResource;
